package com.hjzgg.example.springboot.test;

import org.apache.commons.lang3.StringUtils;
import org.apache.pdfbox.pdmodel.PDDocument;
import org.apache.pdfbox.rendering.PDFRenderer;
import org.springframework.util.Base64Utils;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.ByteArrayOutputStream;
import java.io.File;

/**
 * @author hujunzheng
 * @create 2019-02-27 13:03
 **/
public class PdfTest {
    public static void main(String[] args) throws Exception {
        String pdfBase64 = "";
        PDDocument pdDocument = PDDocument.load(Base64Utils.decodeFromString(pdfBase64));
        PDFRenderer renderer = new PDFRenderer(pdDocument);
        BufferedImage bufferedImage = renderer.renderImage(0);
        //保存图片
        ImageIO.write(bufferedImage, "png", new File("D:\\code\\xxx.png"));
        //Base64
        ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
        ImageIO.write(bufferedImage, "png", outputStream);
        String imgBase64 = Base64Utils.encodeToString(outputStream.toByteArray());
        imgBase64.replaceAll("\\s*|\t|\r|\n", StringUtils.EMPTY);
        System.out.println(imgBase64);
    }
}